import React from 'react';
import './App.css';
import Weather from './Weather';

function App() {
  return (
    <div>
      <h1>Hello Tanveer</h1>
      <hr />
      <div className='body.sunny'>
        <Weather />
      </div>
    </div>
  );
}

export default App;
